/* harmony default export */ var Main = ({
  data() {
    return {
      category: null,
      categoryName: '',
      productFormVisible: false,
      product: {
        id: null,
        name: '',
        description: '',
        price: ''
      },
      productRules: {
        name: [{
          required: true,
          message: 'Навазние товара обязательно',
          trigger: 'blur'
        }, {
          min: 3,
          max: 255,
          message: 'Навазние товара должно быть от 3 до 255 символов',
          trigger: 'blur'
        }],
        description: [{
          required: true,
          message: 'Описание товара обязательно',
          trigger: 'blur'
        }, {
          min: 3,
          max: 5000,
          message: 'Навазние товара должно быть от 3 до 5000 символов',
          trigger: 'blur'
        }],
        price: [{
          type: 'number',
          required: true,
          message: 'Цена обязательна'
        }]
      }
    };
  },

  computed: {
    categories() {
      return this.$store.getters.categories;
    },

    activeCategory() {
      return this.$store.getters.activeCategory;
    },

    products() {
      return this.$store.getters.products;
    }

  },

  mounted() {
    if (!this.categories.length) {
      this.$store.dispatch('FETCH_CATEGORIES');
    }
  },

  components: {
    AdminNavMenu: AdminNavMenu["a" /* default */]
  },
  methods: {
    selectCategory() {
      this.categoryName = '';

      if (!this.category) {
        this.$store.dispatch('SET_ACTIVE_CATEGORY', null);
        return;
      }

      if (!this.category.id) {
        return this.$store.dispatch('ADD_CATEGORY', {
          categoryName: this.category,
          fn: category => {
            this.$notify({
              title: 'Success',
              message: '"' + category.name + '" создана',
              type: 'success'
            });
            this.$store.dispatch('SET_ACTIVE_CATEGORY', category);
            this.$store.dispatch('FETCH_PRODUCTS', category);
            this.category = category;
            this.categoryName = category.name;
          }
        });
      }

      this.$store.dispatch('SET_ACTIVE_CATEGORY', this.category);
      this.$store.dispatch('FETCH_PRODUCTS', this.category);
      this.categoryName = this.category.name;
    },

    categoryEdit(category, categoryName) {
      this.$store.dispatch('UPDATE_CATEGORY', {
        category: {
          id: category.id,
          name: categoryName
        },
        fn: category => {
          this.$notify({
            title: 'Success',
            message: '"' + this.category.name + '" переименована в "' + category.name + '"',
            type: 'success'
          });
          this.$store.dispatch('SET_ACTIVE_CATEGORY', category);
          this.category = category;
        }
      });
    },

    categoryDelete(category) {
      this.$store.dispatch('DELETE_CATEGORY', {
        category: category,
        fn: () => {
          this.$notify({
            title: 'Success',
            message: '"' + category.name + '" удалена',
            type: 'success'
          });
          this.category = null;
          this.categoryName = '';
        }
      });
    },

    productEdit(product) {
      console.log(product);
      this.product.id = product.id;
      this.product.name = product.name;
      this.product.description = product.description;
      this.product.price = product.price;
      this.productFormVisible = true;
    },

    productAdd() {
      this.productFormVisible = true;
    },

    productDelete(product) {
      this.$store.dispatch('DELETE_PRODUCT', {
        product: product,
        fn: () => {
          this.$notify({
            title: 'Success',
            message: '"' + product.name + '" удален',
            type: 'success'
          });
        }
      });
    },

    submitProductForm(product) {
      console.log(product);
      this.$refs['productForm'].validate(valid => {
        if (valid) {
          alert('submit!');
          this.productFormVisible = false;
        } else {
          alert('error submit!!');
        }
      });
    },

    resetProductForm() {
      this.$refs['productForm'].resetFields();
    }

  }
});
